Table_WantedQuest = {
[50010001]={id = 50010001, TeamSync = 1, LevelRange = {26, 35}, NpcId = 1009, Name = '海葵大扫除', Describe = '即使动用大量兵力仍然消灭不光海葵，我们需要集结冒险者的力量！\n推荐区域：沉没之船', Content = 'kill', Params = {monster = 10017, num = 25}, Target = '消灭25只[monsterName]', MapId = 8, Rob = 895, Reward = 250020},
[50030001]={id = 50030001, NpcId = 1024, Name = '揍扁骷髅', Describe = '沉船上的骷髅于日增多，必须定时驱除这些亡灵。\n推荐区域：沉没之船', Params = {monster = 10020, num = 25}},
[50040001]={id = 50040001, NpcId = 1513, Name = '嚣张的螃蟹', Describe = '竟然有一种魔物敢在我的面前横着走，简直不可饶恕！你们谁去给它点颜色。\n推荐区域：海底洞穴', Params = {monster = 10023, num = 25}, MapId = 11},
[50050001]={id = 50050001, NpcId = 1098, Name = '驱赶水母', Describe = '那些滑溜溜的水母弄坏了我捕鱼的渔网！太可恶了！我恨它们！\n推荐区域：海底洞穴', Params = {monster = 10025, num = 25}, MapId = 11},
[50070001]={id = 50070001, NpcId = 1098, Name = '噪音之蛙', Describe = '罗达蛙的叫声吵得海上渔船不得安宁，谁去让它们安静点！\n推荐区域：沉没之船', Params = {monster = 10018, num = 25}},
[50090001]={id = 50090001, NpcId = 1058, Name = '魔花曼陀罗', Describe = '迷藏森林里的魔花真可怕，我都不敢去采药了。能想想办法吗？\n推荐区域：迷藏森林', Params = {monster = 10015, num = 25}, MapId = 6},
[50100001]={id = 50100001, NpcId = 1513, Name = '净化水源', Describe = '听说海底的毒蛙污染了我们这里的水源，很多人都生病了。谁去消灭它们！\n推荐区域：海底洞穴', Params = {monster = 10024, num = 25}, MapId = 11},
[50110001]={id = 50110001, NpcId = 1011, Name = '贪婪的狼', Describe = '那些狼总是袭击商队的货车，叼走粮食，国王希望有勇者愿意去驱逐它们！\n推荐区域：迷藏森林', Params = {monster = 10016, num = 25}, MapId = 6},
[50120001]={id = 50120001, NpcId = 1084, Name = '讥笑的魔菇', Describe = '连魔菇都敢扭动着腰嘲笑我，太可恶了！我和它们势不两立！\n推荐区域：沉没之船', Params = {monster = 10021, num = 25}},
[50130001]={id = 50130001, NpcId = 1513, Name = '骸骨的恶作剧', Describe = '什么？！幽灵船上的邪骸战士把皇家卫兵揍扁了？谁去教教它们如何做一具本分的骷髅？\n推荐区域：幽灵船', Params = {monster = 10022, num = 25}, MapId = 9},
[50140001]={id = 50140001, NpcId = 1048, Name = '活泼的剑鱼', Describe = '剑鱼的利齿能把渔船船底咬个大洞！那还怎么出海？！\n推荐区域：海底神殿', Params = {monster = 10027, num = 25}, MapId = 12},
[50160001]={id = 50160001, NpcId = 1024, Name = '海盗骷髅的盛宴', Describe = '复活的海盗骷髅在沉船上举办盛宴，快让他们醒醒！\n推荐区域：沉没之船', Params = {monster = 10020, num = 25}},
----------
[50080001]={id = 50080001, TeamSync = 1, LevelRange = {1, 25}, NpcId = 1084, Name = '活动的树精', Describe = '从西门经过时，边上的树突然动了起来，袭击了我和我的货物，真希望有人能管管。\n推荐区域：普隆德拉西门', Content = 'kill', Params = {monster = 10013, num = 25}, Target = '消灭25只[monsterName]', MapId = 5, Rob = 823, Reward = 250010},
[50390001]={id = 50390001, NpcId = 1129, Name = '不死小强', Describe = '下水道有一种生物叫小强，传说小强打不死，你要不要去试试？\n推荐区域：首都地下水道2F', Params = {monster = 10008, num = 25}, MapId = 4},
[50400001]={id = 50400001, NpcId = 1129, Name = '小强中的战斗机', Describe = '比小强更顽强的是玛勒盗虫！你能结束它的不死神话吗？\n推荐区域：首都地下水道2F', Params = {monster = 10009, num = 25}, MapId = 4},
[50410001]={id = 50410001, NpcId = 1020, Name = '苍蝇清除计划', Describe = '人类和苍蝇的奋战会持续到世界毁灭吧。\n推荐区域：普隆德拉西门', Params = {monster = 10010, num = 25}},
[50420001]={id = 50420001, NpcId = 1270, Name = '破坏王溜溜猴', Describe = '西门的猴子把花园和墓地当成了它们玩耍的乐园，弄坏了花花草草，让人恨得牙痒痒！\n推荐区域：普隆德拉西门', Params = {monster = 10011, num = 25}},
[50430001]={id = 50430001, NpcId = 1048, Name = '驱赶蝗虫', Describe = '我不反感那些蝗虫的音乐，但经常在我的菜园办音乐会就实在是…，冒险者来帮我驱赶他们吧。\n推荐区域：普隆德拉西门', Params = {monster = 10012, num = 25}},
[50440001]={id = 50440001, NpcId = 1129, Name = '卫兵的克星', Describe = '我负责下水道的守备，可是每次那些成群的盗虫都让我毛骨悚然……\n推荐区域：首都地下水道1F', Params = {monster = 10005, num = 25}, MapId = 3},
[50450001]={id = 50450001, NpcId = 1129, Name = '人类仇敌', Describe = '比小强稍微可爱一点，但同样和人类不共戴天的大概就是下水道里的白鼠了……\n推荐区域：首都地下水道1F', Params = {monster = 10004, num = 25}, MapId = 3},
[50460001]={id = 50460001, NpcId = 1129, Name = '干尸传说', Describe = '听说已经有好几个人被吸血蝙蝠吸干血变成了一具干尸……我该怎么办？在线等！\n推荐区域：首都地下水道1F', Params = {monster = 10007, num = 25}, MapId = 3},
[50470001]={id = 50470001, NpcId = 1129, Name = '跳舞的魔菇', Describe = '有只会扭动的魔菇竟然邀请我和它一起跳舞……我再也不想看到这种生物了！\n推荐区域：首都地下水道1F', Params = {monster = 10006, num = 25}, MapId = 3},
----------
[50150001]={id = 50150001, TeamSync = 1, LevelRange = {36, 45}, NpcId = 1111, Name = '哥布灵破坏团！', Describe = '哥布灵又成群结队出来洗劫商团了，这些财迷一定要让它们受点教训！。\n推荐区域：哥布灵森林', Content = 'kill', Params = {monster = 10029, num = 25}, Target = '消灭25只哥布灵', MapId = 33, Rob = 964, Reward = 250030},
[50200001]={id = 50200001, NpcId = 1044, Name = '丰厚的回报', Describe = '商人的诚信就是招牌，如果你愿意为我去消灭海底的马克，我保证给你丰厚的回报！\n推荐区域：海底神殿', Params = {monster = 10028, num = 25}, Target = '消灭25只[monsterName]', MapId = 12},
[50210001]={id = 50210001, NpcId = 1052, Name = '煤矿的打劫者', Describe = '那些喷射哥布灵抢劫了我们不少煤矿！谁去教训它们！\n推荐区域：哥布灵森林', Params = {monster = 10035, num = 25}, Target = '消灭25只[monsterName]'},
[50220001]={id = 50220001, NpcId = 1024, Name = '弓箭哥布灵', Describe = '曾经我也是一名统帅，直到被哥布灵偷袭负伤...实在是咽不下这口恶气，你能帮我吗？\n推荐区域：哥布灵森林', Params = {monster = 10034, num = 25}, Target = '消灭25只[monsterName]'},
[50240001]={id = 50240001, NpcId = 1052, Name = '蜂兵疯了', Describe = '哎呀，那些蜂兵都发疯了，见人就蛰！现在连出行都要小心翼翼的，就没有什么办法了吗？\n推荐区域：妙勒尼山脉', Params = {monster = 10036, num = 25}, Target = '消灭25只[monsterName]', MapId = 14},
[50250001]={id = 50250001, NpcId = 1054, Name = '噬人的花', Describe = '只见过人摘花，现在花都吃人啦，那还了得！谁去清理掉它们？\n推荐区域：妙勒尼山脉', Params = {monster = 10037, num = 25}, Target = '消灭25只[monsterName]', MapId = 14},
[50260001]={id = 50260001, NpcId = 1272, Name = '巨大的蜈蚣', Describe = '比我还大的蜈蚣真是太可怕了，有勇士去把它们干掉吗？不然我会彻夜难眠。\n推荐区域：妙勒尼山脉', Params = {monster = 10038, num = 25}, Target = '消灭25只[monsterName]', MapId = 14},
[50270001]={id = 50270001, NpcId = 1009, Name = '彩蝶精灵', Describe = '不要因为彩蝶精灵长得美，就下不了手……我们需要不会被美色迷惑的勇士。\n推荐区域：妙勒尼山脉', Params = {monster = 10039, num = 25}, Target = '消灭25只[monsterName]', MapId = 14},
[53390001]={id = 53390001, NpcId = 1058, Name = '喷射哥布灵', Describe = '那些喷射哥布灵整天飞来飞去，晃得人头晕眼花，有哪位冒险者愿意去赶走它们？\n推荐区域：哥布灵森林', Params = {monster = 10035, num = 25}, Target = '消灭25只[monsterName]'},
[53400001]={id = 53400001, NpcId = 1513, Name = '狂暴人鱼', Describe = '在海底神殿的人鱼最近开始狂暴了，胡乱地攻击附近的行人，有谁能去处理一下？\n推荐区域：海底神殿', Params = {monster = 10026, num = 25}, Target = '消灭25只[monsterName]', MapId = 12},
[53540001]={id = 53540001, NpcId = 1070, Name = '消灭哥布灵', Describe = '哥布灵森林的哥布灵们又开始捣蛋了，有哪位冒险者愿意去处理下？\n推荐区域：哥布灵森林', Params = {monster = 10029, num = 30}, Target = '消灭30只哥布灵'},
[53560001]={id = 53560001, NpcId = 1100, Name = '清理兵蚁', Describe = '蚂蚁洞穴的兵蚁繁衍得太快了，有冒险者去清剿一下吗？\n推荐区域：蚂蚁密穴', Params = {monster = 10040, num = 25}, Target = '消灭25只[monsterName]', MapId = 15},
----------
[50280001]={id = 50280001, TeamSync = 1, LevelRange = {46, 55}, NpcId = 1008, Name = '搬土专家', Describe = '蚂蚁洞穴日渐扩大的核心环节是搬运土壤的工蚁，讨伐工蚁能有效缓解这一现象\n推荐区域：蚂蚁密穴', Content = 'kill', Params = {monster = 10041, num = 25}, Target = '消灭25只[monsterName]', MapId = 15, Rob = 1037, Reward = 250040},
[50290001]={id = 50290001, NpcId = 1048, Name = '灭白蚁计划', Describe = '啊！真是无法原谅，送梦往罗克的木材全被白蚁啃食了，损失严重！\n推荐区域：蚂蚁密穴', Params = {monster = 10042, num = 25}},
[50300001]={id = 50300001, NpcId = 1129, Name = '奶妈黑蚁', Describe = '消灭蚁群，必须先消灭它们中的奶妈黑蚁！\n推荐区域：蚂蚁密穴', Params = {monster = 10044, num = 25}},
[50310001]={id = 50310001, NpcId = 1024, Name = '蚁卵守护者', Describe = '接受了采集蚁卵的任务，没想到出现几只兵蚁护卫，很厉害啊，可以帮我打败它们吗？\n推荐区域：蚂蚁密穴', Params = {monster = 10040, num = 25}},
[50320001]={id = 50320001, NpcId = 1111, Name = '矿工基尔瑟', Describe = '蚁后手下的基尔瑟把蚂蚁洞穴越挖越大了，我们不能坐视不管。\n推荐区域：蚂蚁密穴', Params = {monster = 10045, num = 25}},
[50330001]={id = 50330001, NpcId = 1070, Name = '驱赶红蝙蝠', Describe = '那些可恶的红蝙蝠，看到火光就会发动攻击，搞的我们都无法探测了。\n推荐区域：蚂蚁密穴', Params = {monster = 10043, num = 25}},
[50340001]={id = 50340001, NpcId = 1048, Name = '挑战大嘴鸟', Describe = '据说大嘴鸟是禽类中的传奇，打败它的你也将成为传奇。\n推荐区域：苏克拉特沙漠', Params = {monster = 10047, num = 25}, MapId = 35},
[50350001]={id = 50350001, NpcId = 1232, Name = '鬼畜摩卡', Describe = '沙漠观光时看到了摩卡的样子，鬼畜的身姿在脑内挥之不去，请帮我摆脱这个噩梦吧！\n推荐区域：苏克拉特沙漠', Params = {monster = 10046, num = 25}, MapId = 35},
[53130001]={id = 53130001, NpcId = 1327, Name = '帮助商旅团', Describe = '巨石怪对我们商旅团的威胁太大了，有冒险者愿意帮我们解决这个麻烦吗？\n推荐区域：梦罗克', Params = {monster = 10101, num = 25}, MapId = 16},
[53140001]={id = 53140001, NpcId = 1070, Name = '驱逐沙漠之狼', Describe = '沙漠之狼总是在一些交通要道上游走，必须赶走这些贪婪的狼。\n推荐区域：梦罗克', Params = {monster = 10049, num = 25}, MapId = 16},
[53150001]={id = 53150001, NpcId = 1552, Name = '逃走的魔锅蛋', Describe = '准备吃鸟蛋时，那只蛋突然从厨房里逃走，把我的平底锅也偷走了，请帮我夺回来吧！\n推荐区域：苏克拉特沙漠', Params = {monster = 10048, num = 25}, MapId = 35},
----------
[53010001]={id = 53010001, LevelRange = {1, 25}, NpcId = 1078, Name = '风景摄影', Describe = '西门的普勒花园可是难得的美景，去帮我拍张照片吧。\n推荐区域：普隆德拉西门', Content = 'selfie', Params = _EmptyTable, Target = '拍摄1张照片', MapId = 5, Rob = 823, Reward = 250010},
[53070001]={id = 53070001, NpcId = 1045, Name = '收集结晶', Describe = '杰勒比结晶真的是非常的漂亮，你不觉得吗？那你帮我找一些杰勒比结晶吧。\n推荐区域：普隆德拉西门', Content = 'remove_item', Params = {item = {{id = 52101, num = 5}}}, Target = '收集5个杰勒比结晶'},
[53080001]={id = 53080001, NpcId = 1042, Name = '收集柔毛', Describe = '想要一些柔毛用来做暖和的衣服呢，能不能收集一些柔毛来呢？\n推荐区域：首都地下水道1F', Content = 'remove_item', Params = {item = {{id = 52151, num = 5}}}, Target = '收集5个柔毛', MapId = 3},
[53090001]={id = 53090001, NpcId = 1067, Name = '收集腐烂绷带', Describe = '伤员太多，绷带不够用了！帮我找些腐烂绷带来吧，消毒之后勉强能凑合。\n推荐区域：首都地下水道1F', Content = 'remove_item', Params = {item = {{id = 52201, num = 5}}}, Target = '收集5个腐烂绷带', MapId = 3},
[53380001]={id = 53380001, NpcId = 1009, Name = '猴子将军', Describe = '本想养只猴子将军拉风一下，谁知它们太吵了，请帮我送走它们吧！\n推荐区域：普隆德拉西门', Content = 'move', Target = '去西门放生溜溜猴'},
[54100001]={id = 54100001, NpcId = 1045, Name = '收集铁', Describe = '铁作为人们工艺的结晶已经渐渐走进大家的生活了，我当然也需要一些啦~\n推荐区域：首都地下水道1F', Content = 'remove_item', Params = {item = {{id = 52401, num = 1}}}, Target = '收集1个铁', MapId = 3},
----------
[53020001]={id = 53020001, LevelRange = {26, 35}, NpcId = 1078, Name = '风景摄影', Describe = '不知道什么时候，沉船的船长室也成了一个旅游胜地，帮我拍张照片吧\n推荐区域：沉没之船', Content = 'selfie', Params = _EmptyTable, Target = '拍摄1张照片', MapId = 8, Rob = 895, Reward = 250020},
[53040001]={id = 53040001, NpcId = 1098, Name = '跑上陆地的鱼', Describe = '这条剑鱼竟然跑上了陆地……请送它回大海吧。\n推荐区域：沉没之船', Content = 'move', Target = '去沉没之船放生剑鱼'},
[53120001]={id = 53120001, NpcId = 1045, Name = '收集亡者遗物', Describe = '那些遭噬人花袭击的人死无全尸，太可怜了，至少要把他们生前的遗物夺回来！\n推荐区域：沉没之船', Content = 'remove_item', Params = {item = {{id = 52202, num = 5}}}, Target = '收集5个亡者遗物'},
[53410001]={id = 53410001, Name = '海底神殿', Describe = '听说海底神殿很壮观，有冒险者能帮我拍个照片嘛？\n推荐区域：海底神殿', Target = '拍摄遗迹·深海神殿', MapId = 12},
[54120001]={id = 54120001, NpcId = 1067, Name = '收集钢铁', Describe = '用钢铁可以制作出更加强大的武器和装备，为了将来发大财，我得囤一些。\n推荐区域：幽灵船', Content = 'remove_item', Params = {item = {{id = 52402, num = 1}}}, Target = '收集1个钢铁', MapId = 9},
[54140001]={id = 54140001, NpcId = 1045, Name = '收集煤炭', Describe = '最近我们从煤炭中研究到了一些可贵的资料，但是太少了，我们还需要一些煤炭。\n推荐区域：哥布灵森林', Content = 'remove_item', Params = {item = {{id = 52403, num = 2}}}, Target = '收集2个煤炭', MapId = 33},
[54240001]={id = 54240001, NpcId = 1045, Name = '收集结晶', Describe = '杰勒比结晶真的是非常的漂亮，你不觉得吗？那你帮我找一些杰勒比结晶吧。\n推荐区域：普隆德拉西门', Content = 'remove_item', Params = {item = {{id = 52101, num = 5}}}, Target = '收集5个杰勒比结晶', MapId = 5},
