[54160001]={id = 54160001, NpcId = 1554, Name = '收集沙金', Describe = '哦，像沙子一样美丽的金属，还有比这个更加奇妙的事物吗？\n推荐区域：苏克拉特沙漠', Content = 'remove_item', Params = {item = {{id = 52404, num = 2}}}, Target = '收集2个沙金', MapId = 35},
[54310001]={id = 54310001, NpcId = 1554, Name = '收集不死心脏', Describe = '我们大陆卫队需要研究不死心脏来揭开不死魔物的奥秘，有勇士能帮助我们吗？\n推荐区域：金字塔1F', Content = 'remove_item', Params = {item = {{id = 52203, num = 5}}}, Target = '收集5个不死心脏', MapId = 17},
[54320001]={id = 54320001, NpcId = 1555, Name = '收集坚硬外皮', Describe = '长老树精的皮毛无比坚韧，我们需要一些来制作铠甲，冒险者，能帮我们一下吗？\n推荐区域：斐扬南部区域', Content = 'remove_item', Params = {item = {{id = 52153, num = 5}}}, Target = '收集5个坚硬外皮', MapId = 19},
[54330001]={id = 54330001, NpcId = 1568, Name = '收集粘稠液体', Describe = '我们刺客公会需要一些粘稠液体，这些不起眼的东西对我们来说却有大用，你能帮我弄到吗？\n推荐区域：梦罗克', Content = 'remove_item', Params = {item = {{id = 52152, num = 10}}}, Target = '收集10个粘稠液体'},
[54350001]={id = 54350001, NpcId = 1566, Name = '收集亡者遗物', Describe = '我们商旅会决定回收那些亡者的遗物，你能帮我们找到那些东西吗？\n推荐区域：妙勒尼山脉', Content = 'remove_item', Params = {item = {{id = 52202, num = 10}}}, Target = '收集10个亡者遗物', MapId = 14},
[54360001]={id = 54360001, NpcId = 1045, Name = '收集雪勒结晶', Describe = '有些魔物身上会有美丽的雪勒结晶！好想要一大堆！麻烦你了，冒险者！\n推荐区域：蚂蚁密穴', Content = 'remove_item', Params = {item = {{id = 52104, num = 5}}}, Target = '收集5个雪勒结晶', MapId = 15},
[54380001]={id = 54380001, NpcId = 1551, Name = '脏兮兮的绷带', Describe = '真不知道现在这是怎么了，为什么喜欢这种脏兮兮的绷带呢…害得我又得进货。\n推荐区域：首都地下水道2F', Content = 'remove_item', Params = {item = {{id = 52201, num = 10}}}, Target = '收集10个腐烂绷带', MapId = 4},
[54390001]={id = 54390001, NpcId = 3006, Name = '珍贵的晶体', Describe = '我需要一些珍贵的结晶体来装饰我美丽的宅邸，有的话尽管来找我！\n推荐区域：蚂蚁密穴', Content = 'remove_item', Params = {item = {{id = 52103, num = 10}}}, Target = '收集10个加勒结晶', MapId = 15},
[54410001]={id = 54410001, NpcId = 1042, Name = '收集铁', Describe = '嘿，忽克连最近委托我收集一些锻造的必需品~看来他的精炼生意又兴隆了呢~\n推荐区域：迷藏森林', Content = 'remove_item', Params = {item = {{id = 52401, num = 3}}}, Target = '收集3个铁', MapId = 6},
[54420001]={id = 54420001, NpcId = 1067, Name = '收集钢铁', Describe = '从铁中千锤百炼而出的钢铁是制作武器的好材料呢！\n推荐区域：海底神殿', Content = 'remove_item', Params = {item = {{id = 52402, num = 3}}}, Target = '收集3个钢铁', MapId = 12},
