[53450001]={id = 53450001, LevelRange = {76, 85}, NpcId = 1554, Name = '收集不死心脏', Describe = '我们大陆卫队需要研究不死心脏来揭开不死魔物的奥秘，有勇士能够帮助我们的吗？\n推荐区域：梦罗克', Content = 'remove_item', Params = {item = {{id = 52203, num = 10}}}, Target = '收集10个不死心脏', MapId = 16, Rob = 2233, Reward = 250070},
[53720001]={id = 53720001, NpcId = 1152, Name = '收集赤苍蝇的翅膀', Describe = '赤苍蝇的翅膀可以用来制作各式飞行器，有好心人愿意帮我采集一些来吗？\n推荐区域：兽人地下洞窟', Content = 'gather', Params = {monster = 10076, reward = 81681, num = 20}, Target = '收集20个赤苍蝇的翅膀', MapId = 25},
[53730001]={id = 53730001, NpcId = 1090, Name = '收集小恶魔之心', Describe = '小恶魔之心是不是真的像传闻的那样邪恶？冒险者帮我收集一些来吧，我想研究！\n推荐区域：吉芬地下', Content = 'gather', Params = {monster = 10073, reward = 81691, num = 20}, Target = '收集20个小恶魔之心', MapId = 24},
[53740001]={id = 53740001, NpcId = 1125, Name = '收集兽人的心脏', Describe = '兽人为什么会这么狂暴，我想能从它的心脏中得到一些线索，冒险者，帮我收集些兽人心脏吧。\n推荐区域：兽人地下洞窟', Content = 'gather', Params = {monster = 10075, reward = 81701, num = 20}, Target = '收集20个兽人的心脏', MapId = 25},
[53820001]={id = 53820001, NpcId = 1186, Name = '收集神之手', Describe = '神之手，听上去是很不一般的东西，我们商旅会决定大量收取这种材料。\n推荐区域：吉芬地下', Params = {item = {{id = 52205, num = 8}}}, Target = '收集8个神之手', MapId = 24},
[53880001]={id = 53880001, NpcId = 1562, Name = '绝佳的布料', Describe = '嘿，你可能不知道，犬妖的皮毛是顶级布料，用它制作出的轻甲非常畅销呢！\n推荐区域：克特森林', Content = 'gather', Params = {monster = 10103, reward = 82121, num = 20}, Target = '收集20个犬妖皮毛', MapId = 34},
[53890001]={id = 53890001, NpcId = 1078, Name = '风景摄影', Describe = '犬妖也是拥有悠久历史的种族，他们有着非常古老的遗迹，我很想要一张遗迹的照片！\n推荐区域：克特森林', Content = 'selfie', Params = _EmptyTable, Target = '拍摄先知遗迹', MapId = 34},
[53910001]={id = 53910001, NpcId = 1090, Name = '漂亮的结晶', Describe = '我和金念一样，最近爱上了一种结晶……它的名字叫杰勒比结晶！\n推荐区域：普隆德拉西门', Params = {item = {{id = 52101, num = 15}}}, Target = '收集15个杰勒比结晶', MapId = 5},
[53930001]={id = 53930001, NpcId = 1186, Name = '美丽衣服', Describe = '现在就缺一些柔毛我就能制作出一大批美丽的衣服啦，到时候肯定能赚一笔！\n推荐区域：哥布灵森林', Params = {item = {{id = 52151, num = 15}}}, Target = '收集15个柔毛', MapId = 33},
[53950001]={id = 53950001, Name = '军用绷带', Describe = '绷带又不够了，我们大量需求腐烂绷带这种原材料！\n推荐区域：首都地下水道2F', Params = {item = {{id = 52201, num = 15}}}, Target = '收集15个腐烂绷带', MapId = 4},
[53970001]={id = 53970001, NpcId = 3005, Name = '神秘的液体', Describe = '密穴中的那些红蝙蝠身上有种粘乎乎的东西，我大量收这种材料，有的尽管给我！\n推荐区域：蚂蚁密穴', Params = {item = {{id = 52152, num = 15}}}, Target = '收集15个粘稠液体', MapId = 15},
[53990001]={id = 53990001, NpcId = 3008, Name = '晶体般的人生', Describe = '只有美丽的晶体才配得上我艺人的身份，谁愿意帮我找些来，我一定不亏待他。\n推荐区域：蚂蚁密穴', Params = {item = {{id = 52103, num = 15}}}, Target = '收集15个加勒结晶', MapId = 15},
[54000001]={id = 54000001, NpcId = 3011, Name = '亡者的馈赠', Describe = '那些死去的人为我们留下了无数珍宝，而我的工作就是让这些遗物重现天日！\n推荐区域：金字塔1F', Params = {item = {{id = 52202, num = 15}}}, Target = '收集15个亡者遗物', MapId = 17},
[54010001]={id = 54010001, NpcId = 3012, Name = '不死的源泉', Describe = '无法想像！这些小骷髅身上竟然蕴含着不死的秘密，我们需要研究这些秘密！\n推荐区域：斐扬洞窟1F', Params = {item = {{id = 52203, num = 15}}}, Target = '收集15个不死心脏', MapId = 20},
[54020001]={id = 54020001, NpcId = 3054, Name = '政赫的心愿', Describe = '如果能用坚硬外皮做一件衣服给珍儿，也许我就不会再担心她的安全了吧~\n推荐区域：斐扬南部区域', Params = {item = {{id = 52153, num = 10}}}, Target = '收集10个坚硬外皮', MapId = 19},
[54030001]={id = 54030001, NpcId = 3057, Name = '漂亮的新衣', Describe = '我的衣服应该退休啦，托夏蕾的福，我总算有新衣服可以穿啦，只是还缺点什么…\n推荐区域：斐扬树林', Params = {item = {{id = 52153, num = 15}}}, Target = '收集15个坚硬外皮', MapId = 32},
[54040001]={id = 54040001, NpcId = 3060, Name = '猎人们的研究', Describe = '嘿，我正在研究如何让箭矢发挥最大的力量，可能需要一些雪勒结晶~\n推荐区域：蚂蚁密穴', Params = {item = {{id = 52104, num = 10}}}, Target = '收集10个雪勒结晶', MapId = 15},
[54050001]={id = 54050001, NpcId = 3062, Name = '古怪的晶体', Describe = '我们在长老树精身上发现了雪勒结晶这种奇怪的晶体，现在需要弄一些来研究。\n推荐区域：斐扬南部区域', Params = {item = {{id = 52104, num = 15}}}, Target = '收集15个雪勒结晶', MapId = 19},
[54060001]={id = 54060001, NpcId = 3037, Name = '充满魔力的晶体', Describe = '结晶虐我千百遍，我待结晶如初恋~\n推荐区域：金字塔2F', Params = {item = {{id = 52102, num = 15}}}, Target = '收集15个刹勒空结晶', MapId = 21},
[54070001]={id = 54070001, NpcId = 3041, Name = '恶魔之力的源泉', Describe = '恶魔们的力量来源于他们头顶那狰狞的角，因此，我们需要研究他们力量的源泉。\n推荐区域：金字塔2F', Params = {item = {{id = 52204, num = 15}}}, Target = '收集15个恶魔角', MapId = 21},
[54080001]={id = 54080001, NpcId = 3049, Name = '稀有的玩具', Describe = '那些笨笨的兽人随身会带很多玻璃珠，那玩意孩子们可喜欢了。\n推荐区域：兽人村', Params = {item = {{id = 52154, num = 15}}}, Target = '收集15个玻璃珠', MapId = 23},
[54090001]={id = 54090001, NpcId = 3043, Name = '神的手掌', Describe = '那些神之手拥有神秘的力量，修习魔法的我更需要透彻的研究这些力量。\n推荐区域：古城郊外', Params = {item = {{id = 52205, num = 15}}}, Target = '收集15个神之手', MapId = 26},
[54170001]={id = 54170001, NpcId = 1555, Name = '收集沙金', Describe = '据说金子是永不会被淘汰的……我得收集些沙金，不也是金子么！\n推荐区域：梦罗克', Params = {item = {{id = 52404, num = 5}}}, Target = '收集5个沙金'},
[54190001]={id = 54190001, NpcId = 1566, Name = '收集水银', Describe = '我从来没见过像水银这么奇特的金属，我想我得好好研究研究它。\n推荐区域：斐扬洞窟1F', Params = {item = {{id = 52405, num = 5}}}, Target = '收集5个水银', MapId = 20},
[54200001]={id = 54200001, NpcId = 1045, Name = '收集死人遗骨', Describe = '那些死人的骸骨任由它们堆积荒野可不行，还是都收回来吧。\n推荐区域：吉芬地下', Params = {item = {{id = 52505, num = 3}}}, Target = '收集3个死人遗骨', MapId = 24},
[54210001]={id = 54210001, Name = '收集死人遗骨', Describe = '死亡究竟是有多么可怕？我想死去的人们应该会给我一个答案。\n推荐区域：兽人地下洞窟', Params = {item = {{id = 52505, num = 5}}}, Target = '收集5个死人遗骨', MapId = 25},
[54220001]={id = 54220001, NpcId = 2543, Name = '收集布里刊', Describe = '凡是没有的东西，就会想尽办法要弄到，比如布里刊我就没有……\n推荐区域：兽人地下洞窟', Params = {item = {{id = 52105, num = 5}}}, Target = '收集5个布里刊', MapId = 25},
[54230001]={id = 54230001, NpcId = 1090, Name = '收集慧眼', Describe = '在这双眼瞳背后，蕴含无尽的智慧与力量，还有比这更美妙的物品吗？\n推荐区域：克特森林', Params = {item = {{id = 52155, num = 5}}}, Target = '收集5个慧眼', MapId = 34},
[54590001]={id = 54590001, NpcId = 3371, Name = '白色草药', Describe = '一些恶魔侍者身上带着白色药草，我想知道这种药草有什么作用。\n推荐区域：克雷斯特汉姆', Content = 'gather', Params = {monster = 10067, reward = 82801, num = 20}, Target = '收集20个白色药草', MapId = 27},
[54630001]={id = 54630001, NpcId = 4349, Name = '龙的嘲笑', Describe = '我想学习一下毕帝特地龙那种让人浑身起鸡皮疙瘩的笑声，以后和别人吵架就不怕啦！嚯嚯嚯！\n推荐区域：古城郊外', Content = 'gather', Params = {monster = 10078, reward = 82811, num = 20}, Target = '收集20个毕帝特地龙的笑声', MapId = 26},
[54710001]={id = 54710001, NpcId = 2679, Name = '女人的秘密', Describe = '我有一封重要的信要交给维娜尔，不过送信途中，千万不能把信打开哦！绝对绝对不能！\n推荐区域：古城郊外', Content = 'visit', Params = _EmptyTable, Target = '送信给维娜尔', MapId = 26},
[54720001]={id = 54720001, NpcId = 2678, Name = '追求者', Describe = '之前听维娜尔说她很喜欢毕帝特飞龙，我就给她抓了一只。请帮我带给她。\n推荐区域：古城郊外', Content = 'move', Params = _EmptyTable, Target = '护送毕帝特飞龙', MapId = 26},
[54790001]={id = 54790001, NpcId = 3401, Name = '绿色精灵', Describe = '这个绿色的小可爱真得很讨人喜欢呢，可惜，我不能接受扎克雷的好意。\n推荐区域：普隆德拉北部', Content = 'move', Params = _EmptyTable, Target = '护送森灵', MapId = 42},
[54800001]={id = 54800001, NpcId = 3402, Name = '令人厌烦的噪声', Describe = '要我形容重金属蝗虫的噪声，天啊，这根本没办法用言语形容。赶紧把这家伙送走！\n推荐区域：普隆德拉北部', Content = 'move', Params = _EmptyTable, Target = '护送重金属蝗虫', MapId = 42},
[54860001]={id = 54860001, NpcId = 6235, Name = '美丽的田野', Describe = '怀念普隆德拉北部的村落，那里的田野真是美极了，但是现在我再也没办法看到了。\n推荐区域：普隆德拉北部', Content = 'selfie', Params = _EmptyTable, Target = '拍摄国境线的田野', MapId = 42},
[54900001]={id = 54900001, NpcId = 6195, Name = '收藏家的通知', Describe = '告诉扎克雷，我在古城有了新的发现，请他尽快过来一趟！\n推荐区域：普隆德拉北部', Content = 'visit', Params = _EmptyTable, Target = '送信给扎克雷', MapId = 42},
[54910001]={id = 54910001, NpcId = 6374, Name = '紧急资料', Describe = '我们的物资被一种不知名的魔物截住了，请帮我把这份资料带给克里斯蒂安，让他帮忙分析！\n推荐区域：普隆德拉北部', Content = 'visit', Params = _EmptyTable, Target = '送信给克里斯蒂安', MapId = 42},
[55020001]={id = 55020001, NpcId = 6550, Name = '红色晶体', Describe = '那种令人迷醉的红色晶体，还有比这更美的东西吗？我一定要得到它！\n推荐区域：古城大厅', Params = {item = {{id = 52105, num = 8}}}, Target = '收集8个布里刊', MapId = 30},
[55050001]={id = 55050001, NpcId = 6503, Name = '来自深渊的花', Describe = '美丽的花才是我的最爱，那种来自深渊的花真是太好看了，我想收藏一些这种花！\n推荐区域：克特森林', Params = {item = {{id = 52156, num = 8}}}, Target = '收集8个深渊花', MapId = 34},
[55080001]={id = 55080001, NpcId = 6498, Name = '智慧的象征', Describe = '传说中有种看穿一切的眼睛，有它的帮助，这次料理大赛我想我一定能够夺冠！\n推荐区域：克特森林', Params = {item = {{id = 52155, num = 8}}}, Target = '收集8个慧眼', MapId = 34},
[55140001]={id = 55140001, NpcId = 6463, Name = '轻盈的翅膀', Describe = '更快更有力！这就是猎蝇翅膀比苍蝇翅膀更受人欢迎的原因哦~\n推荐区域：普隆德拉北部', Content = 'gather', Params = {monster = 10124, reward = 83641, num = 20}, Target = '收集20个猎蝇翅膀', MapId = 42},
----------
[53580001]={id = 53580001, TeamSync = 1, LevelRange = {66, 75}, NpcId = 1573, Name = '消灭妖道', Describe = '斐扬洞窟出现了一些妖道，淳朴的斐扬人绝不容许妖言惑众的魔物存在！\n推荐区域：斐扬洞窟1F', Content = 'kill', Params = {monster = 10061, num = 25}, Target = '消灭25只[monsterName]', MapId = 20, Rob = 1880, Reward = 250060},
[53590001]={id = 53590001, NpcId = 1555, Name = '驱除僵尸', Describe = '那些恐怖的活死人太可怕了，冒险者快帮帮我们消灭这些僵尸！\n推荐区域：斐扬洞窟1F', Params = {monster = 10060, num = 25}},
[53600001]={id = 53600001, NpcId = 1554, Name = '幽魂鬼女', Describe = '斐扬地下洞窟的鬼女真的是太可怕了，我可不想被她们抓去成亲，有冒险者能帮帮我们吗？\n推荐区域：斐扬洞窟', Params = {monster = 10065, num = 25}, MapId = 22},
[53610001]={id = 53610001, NpcId = 1503, Name = '驱逐土人', Describe = '一些土人扰乱了我们布在斐扬洞窟中的结界，有冒险者愿意帮我们解决它们吗？\n推荐区域：斐扬洞窟', Params = {monster = 10066, num = 25}, MapId = 22},
[53620001]={id = 53620001, NpcId = 1047, Name = '消灭九尾狐', Describe = '那些九尾狐魔力日益强大，斐扬洞窟越来越危险了，冒险者帮帮我们！\n推荐区域：斐扬洞窟', Params = {monster = 10067, num = 25}, MapId = 22},
----------
[53630001]={id = 53630001, TeamSync = 1, LevelRange = {76, 85}, NpcId = 1191, Name = '还以颜色', Describe = '兽人村的那些凶残兽人最近洗劫了许多人类村庄，我们必须要还以颜色！\n推荐区域：兽人村', Content = 'kill', Params = {monster = 10068, num = 25}, Target = '消灭25只[monsterName]', MapId = 23, Rob = 2233, Reward = 250070},
[53640001]={id = 53640001, NpcId = 1192, Name = '予以还击', Describe = '面对挑衅的兽人，我们必须要予以还击，有冒险者愿意接这个活儿吗？\n推荐区域：兽人村', Params = {monster = 10069, num = 25}},
[53650001]={id = 53650001, NpcId = 1193, Name = '兽人战士', Describe = '兽人中有一些经过训练的强壮战士，非一般人能应付，有冒险者愿意帮助我们吗？\n推荐区域：兽人村', Params = {monster = 10070, num = 25}},
[53660001]={id = 53660001, NpcId = 1514, Name = '梦魇的恐惧', Describe = '梦魇会带给人类无尽的恐惧，它们正在吉芬地下肆意横行，有冒险者愿意去消灭它们吗？\n推荐区域：吉芬地下', Params = {monster = 10071, num = 25}, MapId = 24},
[53670001]={id = 53670001, NpcId = 1560, Name = '小色魔', Describe = '昨天几只小恶魔色眯眯地围着我，还流口水，可恶！请教会它们学会绅士的礼仪！\n推荐区域：吉芬地下', Params = {monster = 10073, num = 25}, MapId = 24},
[53680001]={id = 53680001, NpcId = 1555, Name = '清除兽人腐尸', Describe = '那些散发着恶臭的兽人腐尸污染了这里的环境，有冒险者愿意帮忙清理它们吗？\n推荐区域：兽人地下洞窟', Params = {monster = 10074, num = 25}, MapId = 25},
[53690001]={id = 53690001, NpcId = 1571, Name = '消灭邪骸兽人', Describe = '最近，兽人村开始出现了更凶残的邪骸兽人，冒险者们快帮帮我们！\n推荐区域：兽人地下洞窟', Params = {monster = 10075, num = 25}, MapId = 25},
[53700001]={id = 53700001, NpcId = 1566, Name = '清理赤苍蝇', Describe = '我敢说，苍蝇是这世上最呱噪的魔物，特别是那些赤苍蝇！冒险者，帮我清理下那些噪音吧。\n推荐区域：兽人地下洞窟', Params = {monster = 10076, num = 25}, MapId = 25},
[53830001]={id = 53830001, NpcId = 3371, Name = '热闹的森林', Describe = '那些野猫的叫声使得这片森林都热闹起来了呢！但是我也因此不能不专心修习魔法了，好苦恼！\n推荐区域：克特森林', Params = {monster = 10102, num = 25}, Target = '赶走25只[monsterName]', MapId = 34},
[53840001]={id = 53840001, NpcId = 3372, Name = '精准的射手', Describe = '犬妖弓箭手似乎当我是活靶子了，每天拿我来练习射术，真烦人。\n推荐区域：克特森林', Params = {monster = 10106, num = 25}, Target = '赶走25只[monsterName]', MapId = 34},
[53850001]={id = 53850001, NpcId = 3373, Name = '锻炼犬妖', Describe = '最近我们族群的刺锤犬妖们似乎有点怠惰呢，看来我要好好操练他们一番了！\n推荐区域：克特森林', Params = {monster = 10105, num = 25}, Target = '赶走25只[monsterName]', MapId = 34},
[53860001]={id = 53860001, NpcId = 1227, Name = '充满力量的榔头', Describe = '榔头犬妖以强大的臂力而闻名，你想试试这种狂暴而充满野性的力量吗？\n推荐区域：克特森林', Params = {monster = 10104, num = 25}, Target = '赶走25只[monsterName]', MapId = 34},
[53870001]={id = 53870001, NpcId = 1221, Name = '森林的守卫', Describe = '大斧犬妖是这克特森林的守卫，不要看它们萌萌哒，其实它们很厉害的，谁敢去挑战它们吗？\n推荐区域：克特森林', Params = {monster = 10103, num = 25}, Target = '赶走25只[monsterName]', MapId = 34},
[54440001]={id = 54440001, NpcId = 4322, Name = '驯龙高手', Describe = '万一我将来失业了，我准备转行当一个驯龙高手…的师父！所以，我要先培养一些驯龙高手！\n推荐区域：古城郊外', Params = {monster = 10077, num = 25}, MapId = 26},
[54450001]={id = 54450001, NpcId = 4273, Name = '霸王龙', Describe = '什么都是幼小时最可爱，瞧瞧毕帝特地龙，长大就变成绿贝勒斯那样了！哈哈，我在胡说八道。\n推荐区域：古城郊外', Params = {monster = 10078, num = 25}, MapId = 26},
[54920001]={id = 54920001, NpcId = 6201, Name = '数量膨胀', Describe = '虽然森灵长得十分可爱，但是他们的数量实在是太多了，请帮助我清理一些森灵吧。\n推荐区域：普隆德拉北部', Params = {monster = 10122, num = 25}, MapId = 42},
[54930001]={id = 54930001, NpcId = 6197, Name = '吵闹的音乐会', Describe = '看看那些重金属蝗虫都干了些什么！在我的田野上开音乐会！有冒险者愿意帮我教训他们吗？\n推荐区域：普隆德拉北部', Params = {monster = 10123, num = 25}, MapId = 42},
[54940001]={id = 54940001, NpcId = 6198, Name = '粮食收割者', Describe = '那些讨厌的螳螂，我的粮食还没熟就被他们割下来了，我损失了很多钱！一定要好好教训他们！\n推荐区域：普隆德拉北部', Params = {monster = 10125, num = 25}, MapId = 42},
----------
[53710001]={id = 53710001, LevelRange = {66, 75}, NpcId = 1107, Name = '收集九尾皮毛', Describe = '九尾的皮毛可是非常紧俏的货物呢，有冒险者愿意帮我弄一些来吗？\n推荐区域：斐扬洞窟', Content = 'gather', Params = {monster = 10067, reward = 81671, num = 20}, Target = '收集20个九尾皮毛', MapId = 22, Rob = 1880, Reward = 250060},
[53750001]={id = 53750001, NpcId = 1194, Name = '护送土人', Describe = '那些神秘的土人我已经研究完了，有冒险者愿意帮我把这土人送回斐杨吗？\n推荐区域：斐扬', Content = 'move', Params = _EmptyTable, Target = '护送土人回斐扬', MapId = 18},
[53760001]={id = 53760001, NpcId = 1503, Name = '护送小恶魔', Describe = '这些小恶魔偷偷跟踪我，被我发现了，有冒险者愿意帮我把它们撵回吉芬吗？\n推荐区域：吉芬', Content = 'move', Params = _EmptyTable, Target = '护送小恶魔回吉芬', MapId = 13},
[53770001]={id = 53770001, NpcId = 1078, Name = '风景摄影', Describe = '虽然兽人非常残暴，但是他们的酋长大厅却装饰的很漂亮，冒险者能帮我照张相吗？\n推荐区域：兽人村', Content = 'selfie', Params = _EmptyTable, Target = '拍摄酋长大厅', MapId = 23},
[53780001]={id = 53780001, NpcId = 1078, Name = '风景摄影', Describe = '吉芬地下有个神秘的水晶塔，很想知道它是什么模样呢，冒险者你能帮我拍张照片吗？\n推荐区域：吉芬地下', Content = 'selfie', Params = _EmptyTable, Target = '拍摄敏特拉奇水晶塔', MapId = 24},
[53790001]={id = 53790001, NpcId = 3065, Name = '收集刹勒空结晶', Describe = '我最近发现，刹勒空结晶比其它结晶都好看一万倍！好想要一大堆！\n推荐区域：斐扬洞窟', Content = 'remove_item', Params = {item = {{id = 52102, num = 8}}}, Target = '收集8个刹勒空结晶'},
[53800001]={id = 53800001, NpcId = 1090, Name = '收集恶魔角', Describe = '恶魔角是非常神秘的材料，我们雷根贝勒公司现在急需要一批恶魔角进行研究！\n推荐区域：兽人地下洞窟', Content = 'remove_item', Params = {item = {{id = 52204, num = 8}}}, Target = '收集8个恶魔角', MapId = 25},
[53810001]={id = 53810001, NpcId = 1125, Name = '收集玻璃珠', Describe = '那些玻璃珠还真是漂亮啊，我需要一些玻璃珠来装饰我的水果商店！\n推荐区域：兽人村', Content = 'remove_item', Params = {item = {{id = 52154, num = 8}}}, Target = '收集8个玻璃珠', MapId = 23},
[54180001]={id = 54180001, NpcId = 1568, Name = '收集水银', Describe = '在大家狂热收集金子的时候，我决定收集些银子来显得与众不同。\n推荐区域：斐扬南部区域', Content = 'remove_item', Params = {item = {{id = 52405, num = 3}}}, Target = '收集3个水银', MapId = 19},
----------
[54460001]={id = 54460001, LevelRange = {86, 89}, NpcId = 3399, Name = '鬼怪同盟', Describe = '鬼怪爱好同盟成立以来终于取得了一些小小进展，能帮我把消息带给秋槡吗？\n推荐区域：克雷斯特汉姆', Content = 'visit', Params = _EmptyTable, Target = '送信给秋槡', MapId = 27, Rob = 2616, Reward = 250080},
[54470001]={id = 54470001, NpcId = 1078, Name = '拍摄古城遗迹', Describe = '从小听说古城从前金碧辉煌，真希望谁能拍一张古城正殿的照片给我看看。\n推荐区域：克雷斯特汉姆', Content = 'selfie', Target = '拍摄遗迹·古城修道院'},
[54490001]={id = 54490001, NpcId = 1078, Name = '古城修道院', Describe = '据说古城从前有座非常美丽的修道院，谁能帮我拍一张照片？\n推荐区域：克雷斯特汉姆', Content = 'selfie', Target = '拍摄古城大厅'},
[54500001]={id = 54500001, NpcId = 4349, Name = '邪恶使者', Describe = '自从我见过那些邪恶使者，世间再也没有哪个男子能入我的眼了！不过，还是把他放回去吧。\n推荐区域：古城下水道', Content = 'move', Target = '护送邪恶使者', MapId = 28},
[54530001]={id = 54530001, NpcId = 4375, Name = '恶魔蝙蝠之翼', Describe = '想要一些蝙蝠弓箭手的翅膀做雨棚，请冒险者帮我弄些来吧！\n推荐区域：古城墓地', Content = 'gather', Params = {monster = 10081, reward = 82781, num = 20}, Target = '收集20个蝙蝠弓箭手的翅膀', MapId = 37},
[54550001]={id = 54550001, NpcId = 4266, Name = '变异的蓝鼠', Describe = '我想知道是什么让那些蓝鼠变成了蓝色……我需要一些蓝鼠的皮毛来研究。\n推荐区域：古城下水道', Content = 'gather', Params = {monster = 10085, reward = 82791, num = 20}, Target = '收集20个蓝鼠的皮毛', MapId = 28},
[54580001]={id = 54580001, NpcId = 1014, Name = '征集玻璃珠', Describe = '自从来到这破地方，我的材料储备就快撑不住了。现在我急缺玻璃珠，高价收！在线等！\n推荐区域：兽人村', Content = 'remove_item', Params = {item = {{id = 52105, num = 15}}}, Target = '收集15个玻璃珠', MapId = 23},
[54600001]={id = 54600001, NpcId = 4271, Name = '驱魔人的警告', Describe = '这些来自驱魔人的警告，我心领了。告诉他们，我决定的事，没有谁能改变。\n推荐区域：古城下水道', Target = '送信给驱魔人', MapId = 28},
[54620001]={id = 54620001, NpcId = 1078, Name = '血染的教堂', Describe = '据说古城毁灭的时候，正有一个婚礼在教堂中举行着，想看看那座教堂的遗址，帮我拍个照吧。\n推荐区域：古城墓地', Content = 'selfie', Target = '拍摄遗迹·贤者的终点', MapId = 37},
[54640001]={id = 54640001, NpcId = 3401, Name = '研究虎蜥人', Describe = '想知道虎蜥人的蜥蜴皮和别的蜥蜴皮有什么不同。\n推荐区域：古城下水道', Content = 'gather', Params = {monster = 10088, reward = 82821, num = 20}, Target = '收集20个虎蜥人的蜥蜴皮', MapId = 28},
[54650001]={id = 54650001, NpcId = 4477, Name = '亡灵乐章', Describe = '呵呵呵呵……要么给我恶灵的乐章，要么给我你的性命。\n推荐区域：古城墓地', Content = 'gather', Params = {monster = 10080, reward = 82831, num = 20}, Target = '收集20个恶灵的乐章', MapId = 37},
[54660001]={id = 54660001, NpcId = 4426, Name = '做个实验', Describe = '听说在看板上发布委托，能得到大家的帮助。我只是想试一试……把这只恶灵送回下水道吧。\n推荐区域：古城下水道', Content = 'move', Target = '护送恶灵', MapId = 28},
[54670001]={id = 54670001, NpcId = 1232, Name = '暗神官之书', Describe = '我忽然对那些暗神官手里的书很感兴趣。\n推荐区域：古城墓地', Content = 'gather', Params = {monster = 10120, reward = 82841, num = 20}, Target = '收集20本暗神官的咒书', MapId = 37},
[54680001]={id = 54680001, NpcId = 4327, Name = '健美的口牙', Describe = '我想知道那些恶灵是怎么保养牙齿的，看上去似乎用了很好的洁牙剂。\n推荐区域：古城墓地', Content = 'gather', Params = {monster = 10080, reward = 82851, num = 20}, Target = '收集20个恶灵的牙齿', MapId = 37},
[54690001]={id = 54690001, NpcId = 1568, Name = '水银收藏家', Describe = '我收藏的水银每天都会蒸发掉一点，真心累…快帮我再找点来吧！没有水银，我就活不下去了！\n推荐区域：斐扬洞窟1F', Content = 'remove_item', Params = {item = {{id = 52405, num = 5}}}, Target = '收集5个水银', MapId = 20},
[54700001]={id = 54700001, NpcId = 1232, Name = '亡者的信息', Describe = '死人遗骨是那些逝者留在这世上的死亡信息，是我们和逝者的最后一次对话。\n推荐区域：兽人地下洞窟', Content = 'remove_item', Params = {item = {{id = 52505, num = 5}}}, Target = '收集5个死人遗骨', MapId = 25},
[54730001]={id = 54730001, NpcId = 4349, Name = '饲养蓝鼠', Describe = '不知道是谁跟我说，蓝鼠养肥了可以变成可爱的仓鼠……认真我就输了。快帮我把它送回去吧。\n推荐区域：古城下水道', Content = 'move', Target = '护送蓝鼠', MapId = 28},
[54740001]={id = 54740001, NpcId = 1566, Name = '收集水银', Describe = '我从来没见过像水银这么奇特的金属，我想我得好好研究研究它。\n推荐区域：斐扬洞窟1F', Content = 'remove_item', Params = {item = {{id = 52405, num = 5}}}, Target = '收集5个水银', MapId = 20},
[54750001]={id = 54750001, NpcId = 1045, Name = '收集死人遗骨', Describe = '那些死人的骸骨任由它们堆积荒野可不行，还是都收回来吧。\n推荐区域：吉芬地下', Content = 'remove_item', Params = {item = {{id = 52505, num = 3}}}, Target = '收集3个死人遗骨', MapId = 24},
[54760001]={id = 54760001, NpcId = 1555, Name = '收集沙金', Describe = '据说金子是永不会被淘汰的……我得收集些沙金，不也是金子么！\n推荐区域：梦罗克', Content = 'remove_item', Params = {item = {{id = 52404, num = 5}}}, Target = '收集5个沙金', MapId = 16},
[55030001]={id = 55030001, NpcId = 6507, Name = '蓝色宝石', Describe = '我一直很羡慕那些贵族，我也想拥有一串赛依伐项链，真希望有人能完成我这个愿望。\n推荐区域：古城大厅', Content = 'remove_item', Params = {item = {{id = 52106, num = 8}}}, Target = '收集8个赛依伐', MapId = 30},
[55060001]={id = 55060001, NpcId = 6502, Name = '宝石爱好者', Describe = '我的两姐妹都不懂，只有宝石才是一个女人应该爱上的东西啊！对，没错，我要布里刊！\n推荐区域：古城大厅', Content = 'remove_item', Params = {item = {{id = 52105, num = 15}}}, Target = '收集15个布里刊', MapId = 30},
[55070001]={id = 55070001, NpcId = 6500, Name = '神秘的手掌', Describe = '也许我收集到那些神之手，它们的力量能够让我进阶成料理大师也说不定！\n推荐区域：古城郊外', Content = 'remove_item', Params = {item = {{id = 52205, num = 15}}}, Target = '收集15个神之手', MapId = 26},
[55380001]={id = 55380001, NpcId = 6984, Name = '软软的帽子', Describe = '如果有3个彩色外皮，我就可以缝制出软软的圣诞帽了，多希望彩色外皮可以从天而降啊！\n推荐区域：钟楼1F', Content = 'remove_item', Params = {item = {{id = 52411, num = 3}}}, Target = '收集3个彩色外皮', MapId = 44},
[55410001]={id = 55410001, NpcId = 5356, Name = '啪唧啪唧', Describe = '啪唧想要一些铠甲碎片，唧唧唧，给啪唧一点碎片吧！3片就好啦！\n推荐区域：古城大厅', Content = 'remove_item', Params = {item = {{id = 52406, num = 3}}}, Target = '收集3个铠甲碎片', MapId = 30},
----------
[54480001]={id = 54480001, TeamSync = 1, LevelRange = {86, 89}, NpcId = 4272, Name = '蓝鼠清除行动', Describe = '古城下水道中的蓝鼠吱吱吱吱吵得人头疼，得赶快把它们都清理了，还下水道一片安宁！\n推荐区域：古城下水道', Content = 'kill', Params = {monster = 10085, num = 25}, Target = '消灭25只[monsterName]', MapId = 28, Rob = 2616, Reward = 250080},
[54510001]={id = 54510001, NpcId = 4275, Name = '残暴虎蜥人', Describe = '我觉得那些虎蜥人挺可爱的，不过不能因为它们长得可爱就手软。\n推荐区域：古城下水道', Params = {monster = 10088, num = 25}},
[54520001]={id = 54520001, NpcId = 4304, Name = '骚扰狂魔史汀', Describe = '下水道的史汀简直丧心病狂，竟然敢摸莉莎的……我和他们势不两立！\n推荐区域：古城下水道', Params = {monster = 10087, num = 25}},
[54540001]={id = 54540001, NpcId = 3400, Name = '可恨的蝙蝠', Describe = '上次，有只蝙蝠弓箭手打碎了我正在研究的一片骸骨……他们真是考古者的噩梦！\n推荐区域：古城墓地', Params = {monster = 10081, num = 25}, Target = '消灭25只蝙蝠弓箭手', MapId = 37},
[54560001]={id = 54560001, NpcId = 4349, Name = '恶灵的歌声', Describe = '听……那是下水道中的恶灵在唱歌……啊啊啊啊！这歌声会迷惑我们！谁去阻止他们！\n推荐区域：古城墓地', Params = {monster = 10080, num = 25}, MapId = 37},
[54570001]={id = 54570001, NpcId = 4000, Name = '黑暗神官', Describe = '我看到神棍…哦不，神官就头疼，包括暗神官在内，别以为有个“暗”字他就不是神官了。\n推荐区域：古城墓地', Params = {monster = 10120, num = 25}, MapId = 37},
[54610001]={id = 54610001, NpcId = 1227, Name = '诚挚的委托', Describe = '黑暗祭司，听起来就知道他们干不出什么好事，我讨厌所有银发的人，快让他们消失吧！\n推荐区域：古城墓地', Params = {monster = 10121, num = 25}, MapId = 37},
----------
[54770001]={id = 54770001, LevelRange = {90, 100}, NpcId = 3399, Name = '年幼的恶魔', Describe = '不得不说，小巴风特真是可爱极了！真舍不得把它送回去啊。\n推荐区域：古城大厅', Content = 'move', Params = _EmptyTable, Target = '护送小巴风特', MapId = 30, Rob = 2950, Reward = 250090},
[54780001]={id = 54780001, NpcId = 3400, Name = '长着牙齿的书', Describe = '谁来帮我把这魔书带走！天啊，说起来你可能不信，我被书给咬了！\n推荐区域：古城大厅', Target = '护送飞行魔书'},
[54810001]={id = 54810001, NpcId = 4532, Name = '腐朽的恶魔', Describe = '我的天，为了养这个恐怖的小东西，我的所有都腐朽成一片灰尘了！我再也不想看到这家伙了！\n推荐区域：钟楼1F', Target = '护送朽魔', MapId = 44},
[54820001]={id = 54820001, NpcId = 4568, Name = '卡普拉总部', Describe = '艾尔帕兰坐落着美丽的卡普拉总部，真是怀念那时候的日子啊，你能帮我拍一张照片吗？\n推荐区域：艾尔帕兰', Content = 'selfie', Target = '拍摄卡普拉总部', MapId = 43},
[54830001]={id = 54830001, NpcId = 4322, Name = '运河船坞', Describe = '记得还小的时候我经常去艾尔帕兰的船坞游玩，也不知道现在变成什么样子了…\n推荐区域：艾尔帕兰', Content = 'selfie', Target = '拍摄水城船坞', MapId = 43},
[54840001]={id = 54840001, NpcId = 6234, Name = '神秘的星盘', Describe = '你知道的，我对神秘的星空一直充满向往，而现在钟楼竟然出现了神秘的星盘。\n推荐区域：钟楼2F', Content = 'selfie', Target = '拍摄逆转的星盘', MapId = 45},
[54850001]={id = 54850001, NpcId = 6295, Name = '废弃地域', Describe = '没想到钟楼地下还隐藏着这么大的废域，我真想看看这片废域啊。\n推荐区域：钟楼地下', Content = 'selfie', Target = '拍摄废域', MapId = 46},
[54870001]={id = 54870001, NpcId = 6155, Name = '魔物资料', Describe = '嘿，这是莱耶·蒙德拜托我整理的魔物资料，请帮我完整地把资料带给他哦~\n推荐区域：克雷斯特汉姆', Content = 'visit', Target = '送信给莱耶·蒙德', MapId = 27},
[54880001]={id = 54880001, NpcId = 6109, Name = '有味道的信件', Describe = '自从来到古城，我多久没有尝到哈瑞亲手做的美食了？替我告诉他，我很快就会回去！\n推荐区域：艾尔帕兰', Content = 'visit', Target = '送信给哈瑞', MapId = 43},
[54890001]={id = 54890001, NpcId = 6196, Name = '邻家的小孩', Describe = '出来这么久，挺想念邻家那个古灵精怪的小淘气埃尔莎，能帮我送封信给她吗？\n推荐区域：艾尔帕兰', Content = 'visit', Target = '送信给埃尔莎', MapId = 43},
[55040001]={id = 55040001, NpcId = 6501, Name = '女神的心', Describe = '你看看这些酷似女神的宝石，它们不应该叫做泯灭之心，应该称为女神之心才对！\n推荐区域：古城大厅', Content = 'remove_item', Params = {item = {{id = 52206, num = 15}}}, Target = '收集15个泯灭之心'},
[55090001]={id = 55090001, NpcId = 6499, Name = '女神的双眼', Describe = '我想，应该称呼他们为智慧女神的双眼更为合适，大量求购慧眼！\n推荐区域：克特森林', Content = 'remove_item', Params = {item = {{id = 52155, num = 15}}}, Target = '收集15个慧眼', MapId = 34},
[55100001]={id = 55100001, NpcId = 6497, Name = '铠甲复原', Describe = '神说，那些久经战场的铠甲不应该是现在的样子，我要把那些铠甲复原！\n推荐区域：古城大厅', Content = 'remove_item', Params = {item = {{id = 52406, num = 3}}}, Target = '收集3个铠甲碎片'},
[55110001]={id = 55110001, NpcId = 6549, Name = '神秘原力', Describe = '只有我才知道，那些铠甲上有着一种神秘的原力，为了研究这力量，我需要大量的铠甲碎片！\n推荐区域：古城大厅', Content = 'remove_item', Params = {item = {{id = 52406, num = 5}}}, Target = '收集5个铠甲碎片'},
[55120001]={id = 55120001, NpcId = 6466, Name = '灰森灵的皮肤', Describe = '灰森灵的皮肤比之北部的森灵更加坚硬，特比适合缝制皮包呢！\n推荐区域：钟楼地下', Content = 'gather', Params = {monster = 10134, reward = 83621, num = 20}, Target = '收集20个灰森灵的皮肤', MapId = 46},
[55130001]={id = 55130001, NpcId = 6465, Name = '诡异的触手', Describe = '你知道吗？梅纳海葵的触手只要处理得好就能成为一道美味的佳肴呢！\n推荐区域：钟楼地下', Content = 'gather', Params = {monster = 10132, reward = 83631, num = 20}, Target = '收集20个海葵触手', MapId = 46},
[55150001]={id = 55150001, NpcId = 6509, Name = '魔力绷带', Describe = '那些黑暗生物身上令人作呕的绷带不应该存在于世，我这次要彻底净化了它们！\n推荐区域：古城大厅', Content = 'gather', Params = {monster = 10095, reward = 83651, num = 20}, Target = '收集20个裘卡的绷带'},
[55160001]={id = 55160001, NpcId = 6496, Name = '重铸古剑', Describe = '最近新发明了一种武器合剂，想找一些破碎的武器碎片用来实验！\n推荐区域：古城大厅', Content = 'gather', Params = {monster = 10096, reward = 83661, num = 20}, Target = '收集20个利剑碎片'},
[55170001]={id = 55170001, NpcId = 6495, Name = '古典魔书', Describe = '我认为那些飞行魔书身上记载了了不起的炼金术，只要有它们身上的书页，我就能研究出来！\n推荐区域：古城大厅', Content = 'gather', Params = {monster = 10093, reward = 83671, num = 20}, Target = '收集20个破碎的书页'},
[55180001]={id = 55180001, NpcId = 6493, Name = '铁锈斑斑', Describe = '不停进行研究才是我的宿命，现在我想研究一下那些幽灵剑士身上铠甲的成份。\n推荐区域：古城骑士团', Content = 'gather', Params = {monster = 10090, reward = 83681, num = 20}, Target = '收集20个铠甲铁锈', MapId = 29},
[55190001]={id = 55190001, NpcId = 6494, Name = '上等箭羽', Describe = '幽灵弓箭手的箭威力惊人，根据我的猜想一定是箭羽的材质问题！谁来帮我验证一下我的猜想？\n推荐区域：古城骑士团', Content = 'gather', Params = {monster = 10089, reward = 83691, num = 20}, Target = '收集20个箭羽', MapId = 29},
[55200001]={id = 55200001, NpcId = 6516, Name = '急需指针', Describe = '为什么需要指针？我有必要告诉你们吗？你们只需要我要这个就足够了！\n推荐区域：钟楼2F', Content = 'gather', Params = {monster = 10130, reward = 83701, num = 20}, Target = '收集20个钟怪指针', MapId = 45},
[55210001]={id = 55210001, NpcId = 6511, Name = '废弃魔杖', Describe = '我知道我没有成为魔法师的天赋，但是我还是希望能拥有一款真正的魔杖。\n推荐区域：钟楼1F', Content = 'gather', Params = {monster = 10127, reward = 83711, num = 20}, Target = '收集20个朽木杖', MapId = 44},
[55220001]={id = 55220001, NpcId = 6513, Name = '齿轮巨柱', Describe = '真想看看令艾尔帕兰人引以为傲的钟楼啊，听说里面有着齿车的巨柱，现在根本没有仿建呢！\n推荐区域：钟楼1F', Content = 'selfie', Target = '拍摄齿车的巨柱 ', MapId = 44},
[55230001]={id = 55230001, NpcId = 6514, Name = '徒弟的礼物', Describe = '埃尔莎也该有个像样的宠物了！这是我抓的伊特瓢虫，帮我送给埃尔莎吧！\n推荐区域：艾尔帕兰', Target = '护送伊特瓢虫', MapId = 43},
[55240001]={id = 55240001, NpcId = 6515, Name = '远方的好友', Describe = '自从贝莉赫尔去了克雷斯特汉姆，我就再也没见过她，真想念她啊！\n推荐区域：克雷斯特汉姆', Content = 'visit', Target = '送信给贝莉赫尔', MapId = 27},
[55250001]={id = 55250001, NpcId = 6474, Name = '彩色的外皮', Describe = '有种彩色的外皮！我从来没有见过这种外皮，真希望能亲眼见见这个稀有的东西啊。\n推荐区域：钟楼1F', Content = 'remove_item', Params = {item = {{id = 52411, num = 3}}}, Target = '收集3个彩色外皮', MapId = 44},
[55260001]={id = 55260001, NpcId = 1078, Name = '翠蓝的冰河', Describe = '听说环绕圣诞村的冰河蓝的让人心碎，有没有冒险者愿意给我拍一张照片呢？\n推荐区域：姜饼城', Content = 'selfie', Target = '拍摄姜饼城冰之河', MapId = 48},
[55270001]={id = 55270001, NpcId = 5200, Name = '冰波利想回家', Describe = '在雪原上遇见一只迷迷糊糊的冰波利，它说它要找雪橇玩，有没有好心人送它去见雪橇呢？\n推荐区域：姜饼城', Target = '护送冰波利去见雪橇', MapId = 48},
[55280001]={id = 55280001, NpcId = 6957, Name = '圣诞糖果', Describe = '好想做糖果给姜饼城的孩子们，可是缺少8个魔女星沙，有人愿意给我吗？\n推荐区域：姜饼城', Content = 'remove_item', Params = {item = {{id = 52157, num = 8}}}, Target = '收集8个魔女星沙', MapId = 48},
[55290001]={id = 55290001, NpcId = 6195, Name = '远方的期待', Describe = '好想去圣诞村度假，那里的必去的景点有哪些，有人愿意为我打听一下吗？\n推荐区域：姜饼城', Content = 'visit', Target = '完成沃斯曼的委托', MapId = 48},
[55300001]={id = 55300001, NpcId = 6964, Name = '激光玩具枪', Describe = '圣诞村要举行激光大战啦，有没有冒险者愿意帮忙“借”一下玩具士兵的激光枪呢？\n推荐区域：玩具工厂1F', Content = 'gather', Params = {monster = 10142, reward = 84021, num = 20}, Target = '收集20个激光玩具枪', MapId = 49},
[55320001]={id = 55320001, NpcId = 6966, Name = '可怜的小猫咪', Describe = '一只黑溜溜的小猫咪在雪地里喵喵叫，勇士们快去营救它！\n推荐区域：姜饼城', Target = '护送小猫咪回到姜饼城', MapId = 48},
[55330001]={id = 55330001, NpcId = 6992, Name = '舞娘的烦恼', Describe = '冰天雪地之中跳舞，感觉膝盖好痛啊，我想要一些保暖的用品。\n推荐区域：钟楼1F', Content = 'remove_item', Params = {item = {{id = 52411, num = 5}}}, Target = '收集5个彩色外皮', MapId = 44},
[55340001]={id = 55340001, NpcId = 5201, Name = '美味的姜饼', Describe = '我烤了一些香喷喷的姜饼，有人愿意帮我拿给小朋友们吗？\n推荐区域：姜饼城', Content = 'visit', Target = '完成沃斯曼的委托', MapId = 48},
[55350001]={id = 55350001, NpcId = 6967, Name = '魔法帽子', Describe = '好像知道绿饼人的帽子下面藏了些什么……是不是香脆的饼干呢？\n推荐区域：玩具工厂1F', Content = 'gather', Params = {monster = 10140, reward = 84031, num = 20}, Target = '收集20个魔法帽子', MapId = 49},
[55370001]={id = 55370001, NpcId = 6941, Name = '浪漫满屋', Describe = '结婚应该选择哪里的教堂？如果有圣诞夜婚礼的照片参考就好了！\n推荐区域：姜饼城', Content = 'visit', Target = '拍摄圣夜礼拜堂', MapId = 48},
[55390001]={id = 55390001, NpcId = 5213, Name = '狂热的炼金术士', Describe = '有了玩具熊头上零件，我就可以获得艾尔帕兰炼金术士大赛的第一名了！\n推荐区域：玩具工厂2F', Content = 'gather', Params = {monster = 10145, reward = 84041, num = 20}, Target = '收集20个精密零件', MapId = 50},
[55420001]={id = 55420001, NpcId = 5300, Name = '偷吃猫粮的盒子', Describe = '夭寿啦，我放在门外给野生喵咪的猫粮被邪恶礼盒吃掉啦！冒险者快帮我拿回来吧！\n推荐区域：玩具工厂1F', Content = 'gather', Params = {monster = 10141, reward = 84051, num = 20}, Target = '收集20个猫粮', MapId = 49},
[55440001]={id = 55440001, NpcId = 5377, Name = '什么是正义', Describe = '给我20个布里刊，我要炼制锁链，把所有邪恶的人都锁起来！不许他们在这个世界生存！\n推荐区域：古城大厅', Content = 'remove_item', Params = {item = {{id = 52105, num = 20}}}, Target = '收集20个布里刊'},
[55450001]={id = 55450001, NpcId = 5300, Name = '慧眼中的魔力', Describe = '只要20个慧眼我就可以打造出独一无二的慧眼法杖了，冒险者请帮帮我！\n推荐区域：克特森林', Content = 'remove_item', Params = {item = {{id = 52155, num = 20}}}, Target = '收集20个慧眼', MapId = 34},
[55460001]={id = 55460001, NpcId = 5303, Name = '深渊的力量', Describe = '一定是我不够强，如果更强……给我20朵深渊花，我要保护大家！\n推荐区域：克特森林', Content = 'remove_item', Params = {item = {{id = 52156, num = 20}}}, Target = '收集20个深渊花', MapId = 34},
[55470001]={id = 55470001, NpcId = 5374, Name = '饼干味的香水', Describe = '我需要15个赛依伐制作饼干味道的香水…奶油味超浓的香水！\n推荐区域：古城大厅', Content = 'remove_item', Params = {item = {{id = 52106, num = 15}}}, Target = '收集15个赛依伐'},
[55480001]={id = 55480001, NpcId = 5381, Name = '丁丁的苦恼', Describe = '哎呀，一不小心把圣诞老人的自动礼物装置机玩坏了，需要20个神之手修理。\n推荐区域：古城郊外', Content = 'remove_item', Params = {item = {{id = 52205, num = 20}}}, Target = '收集20个神之手', MapId = 26},
[55490001]={id = 55490001, NpcId = 5362, Name = '滴答，砰！', Describe = '看来只有定时炸弹才能解决那帮甜饼人，给我8个时间结晶！\n推荐区域：钟楼1F', Content = 'remove_item', Params = {item = {{id = 52107, num = 8}}}, Target = '收集8个时间结晶', MapId = 44},
[55500001]={id = 55500001, NpcId = 5352, Name = '黑暗料理', Describe = '如果使用水晶骨熬制骨头汤，会是什么味道呢？想知道的话，就给我8个水晶骨吧。\n推荐区域：钟楼地下', Content = 'remove_item', Params = {item = {{id = 52207, num = 8}}}, Target = '收集8个水晶骨', MapId = 46},
----------
[54950001]={id = 54950001, TeamSync = 1, LevelRange = {90, 100}, NpcId = 6541, Name = '钟楼变异魔物', Describe = '那些朽魔对我的家乡造成了很大的困扰，不能让他们这么嚣张下去了，有冒险者愿意帮助我吗？\n推荐区域：钟楼1F', Content = 'kill', Params = {monster = 10126, num = 25}, Target = '消灭25只[monsterName]', MapId = 44, Rob = 2950, Reward = 250090},
[54960001]={id = 54960001, NpcId = 6526, Name = '魔女之夜', Describe = '那些诡异的黑魔女实在是艾尔帕兰的一大祸害，如果能清理掉她们那就再好不过了！\n推荐区域：钟楼1F', Params = {monster = 10127, num = 25}},
[54970001]={id = 54970001, NpcId = 6470, Name = '恶毒的巫婆', Describe = '我们时钟守护者已经有数名被巫婆给诅咒了，现在我们守护者需要冒险者们的帮助！\n推荐区域：钟楼1F', Params = {monster = 10129, num = 25}},
[54980001]={id = 54980001, NpcId = 6461, Name = '钟怪', Describe = '变异的时钟怪对我们守护者造成了相当大的困扰，有谁能帮助我们解决这个问题那就太好了。\n推荐区域：钟楼2F', Params = {monster = 10130, num = 25}, MapId = 45},
[54990001]={id = 54990001, NpcId = 6462, Name = '邪灵魔导士', Describe = '嘿，真是令我感兴趣，那些邪灵魔导士竟敢挑战我时之魔法师！呵，我会放过他们吗？\n推荐区域：钟楼2F', Params = {monster = 10131, num = 25}, MapId = 45},
[55000001]={id = 55000001, NpcId = 6468, Name = '梅纳海葵', Describe = '我敢打赌，这些梅纳海葵可比海底的那些棘手多了！敢不敢跟我们守护者一起解决了它们？\n推荐区域：钟楼地下', Params = {monster = 10132, num = 25}, MapId = 46},
[55010001]={id = 55010001, NpcId = 6550, Name = '兽人女战士', Describe = '天知道那些女兽人从哪里来到钟楼地下的！但是我们也不能放任不管，不是吗？\n推荐区域：钟楼地下', Params = {monster = 10135, num = 25}, MapId = 46},
[55310001]={id = 55310001, NpcId = 6972, Name = '饼干小偷', Describe = '我刚烤好的饼干被甜饼人抢走了！！谁帮我教训教训这群强盗？？\n推荐区域：玩具工厂2F', Params = {monster = 10144, num = 25}, MapId = 50},
[55360001]={id = 55360001, NpcId = 6965, Name = '小孩子的噩梦', Describe = '呜呜呜……每天晚上玩具士兵都在我的窗口前看着我……好可怕啊！冒险者帮帮我！\n推荐区域：玩具工厂1F', Params = {monster = 10142, num = 25}, MapId = 49},
[55400001]={id = 55400001, NpcId = 6961, Name = '哭闹的拉链熊', Describe = '每天晚上都能听见我的窗边有哭闹的拉链熊，吵死啦……一定要教训教训它们！\n推荐区域：玩具工厂1F', Params = {monster = 10143, num = 25}, MapId = 49},
[55430001]={id = 55430001, NpcId = 5367, Name = '嫉妒心极强', Describe = '那些绿饼人觉得我们的帽子好看，天天欺负我们！教训它们！教训它们！\n推荐区域：玩具工厂1F', Params = {monster = 10140, num = 25}, MapId = 49},
----------
[55510001]={id = 55510001, TeamSync = 1, LevelRange = {101, 110}, NpcId = 4671, Name = '除鼠计划', Describe = '你一定听过那些土坡鼠在上坡上嗷嗷叫的声音吧？听多了真的好烦！\n推荐区域：艾因布洛克原野', Content = 'kill', Params = {monster = 10153, num = 25}, Target = '消灭25只[monsterName]', MapId = 65, Rob = 3102, Reward = 250100},
[55520001]={id = 55520001, NpcId = 4666, Name = '整蛊的代价', Describe = '高原佩瑞丝仗着外形的优势，伪装在原野里整蛊路过的平民并以此为乐，去教训教训它们！\n推荐区域：国境检查站', Params = {monster = 10156, num = 25}, MapId = 64},
[55530001]={id = 55530001, NpcId = 4669, Name = '迷人的哈比', Describe = '鸟人哈比有着迷人的歌声，自从我和丈夫搬到附近后他便为之着迷，为此我有点担心。\n推荐区域：国境检查站', Params = {monster = 10155, num = 25}, MapId = 64},
[55540001]={id = 55540001, NpcId = 4654, Name = '改善环境', Describe = '邪恶向日葵，有它在周围的植物都无法生存，在这么下去整片国境都别想恢复绿化了。\n推荐区域：国境检查站', Params = {monster = 10154, num = 25}, MapId = 64},
[55550001]={id = 55550001, NpcId = 4662, Name = '生态平衡', Describe = '那些自以为善良的人们放生了太多幼年火烈鸟，会有很大的后患！还是去消灭一些吧。\n推荐区域：熔岩洞窟1F', Params = {monster = 10159, num = 25}, MapId = 66},
[55560001]={id = 55560001, NpcId = 4655, Name = '大色魔', Describe = '还记得骚扰过阿革薇的小恶魔嘛？它们如今进化成了爆炎小恶魔，同时也进化成了大色魔。\n推荐区域：熔岩洞窟3F', Params = {monster = 10157, num = 25}, MapId = 68},
[55570001]={id = 55570001, NpcId = 4662, Name = '该降温了', Describe = '火焰精灵是一个周身持续高温的生物，有它在熔岩洞窟里只会让那里的温度只增不减！\n推荐区域：熔岩洞窟2F', Params = {monster = 10158, num = 25}, MapId = 67},
[55580001]={id = 55580001, Name = '生存的意义', Describe = '世界上怎么会有这种生物？身为马,背上全是带火的鬃毛，又不能驾驭，简直是浪费资源！\n推荐区域：熔岩洞窟1F', Params = {monster = 10160, num = 25}, MapId = 66},
----------
[55590001]={id = 55590001, LevelRange = {101, 110}, NpcId = 5989, Name = '筹备新发明', Describe = '土拨鼠的门牙长的真有意思，我们正在研究这玩意儿能否应用到某项发明中去。\n推荐区域：艾因布洛克原野', Content = 'gather', Params = {monster = 10153, reward = 84091, num = 20}, Target = '收集20个闪亮的大门牙', MapId = 65, Rob = 3102, Reward = 250100},
[55600001]={id = 55600001, NpcId = 4657, Name = '医生的请求', Describe = '高原佩瑞丝身上的绿叶，对伤口愈合有奇效，帮我收集一些来吧。\n推荐区域：国境检查站', Params = {monster = 10156, reward = 84092, num = 20}, Target = '收集20个新生的绿叶', MapId = 64},
[55610001]={id = 55610001, NpcId = 4669, Name = '只是做件衣服', Describe = '我想试试用鸟人哈比的羽毛做件衣服，你别误会绝对没有私心，就是想单纯做一件衣服啦！\n推荐区域：国境检查站', Params = {monster = 10155, reward = 84093, num = 20}, Target = '收集20个鸟人的羽毛', MapId = 64},
[55620001]={id = 55620001, NpcId = 4654, Name = '合理利用', Describe = '由于邪恶向日葵的特殊性，稍加合理利用能杜绝周边有害物质的滋生，帮我带来一点吧。\n推荐区域：国境检查站', Params = {monster = 10154, reward = 84094, num = 20}, Target = '收集20个邪恶的花朵', MapId = 64},
[55630001]={id = 55630001, NpcId = 4660, Name = '有趣的羽毛', Describe = '幼年火烈鸟的羽毛很有意思，脱落后会变成一只小火烈鸟的模样，我很想看看！\n推荐区域：熔岩洞窟2F', Params = {monster = 10159, reward = 84095, num = 20}, Target = '收集20个火烈鸟的羽毛', MapId = 66},
[55640001]={id = 55640001, NpcId = 4658, Name = '意外的财富', Describe = '好多人以为小恶魔留下的结晶是珍贵的宝石，已经让我卖了不少钱！去帮我收集一点来吧。\n推荐区域：熔岩洞窟3F', Params = {monster = 10157, reward = 84096, num = 20}, Target = '收集20个小恶魔结晶', MapId = 68},
[55650001]={id = 55650001, Name = '新能源消耗', Describe = '火焰精灵消失后会变成火焰结晶，这种结晶可以用于能源消耗上，我们正在收集这些资源。\n推荐区域：熔岩洞窟2F', Params = {monster = 10158, reward = 84097, num = 20}, Target = '收集20个火焰结晶     ', MapId = 67},
[55660001]={id = 55660001, NpcId = 4660, Name = '新款烛台', Describe = '你知道吗？小火马的鬃毛长期都处于燃烧状态！很神奇吧？我想弄一些放到烛台上。\n推荐区域：熔岩洞窟1F', Params = {monster = 10160, reward = 84098, num = 20}, Target = '收集20个小火马的鬃毛   ', MapId = 66},
[55670001]={id = 55670001, NpcId = 4670, Name = '圣诞礼物', Describe = '妻子要圣诞礼物，这地带还过什么圣诞？你去帮我收集5个圣诞花环吧！真拿她没办法！\n推荐区域：玩具工厂1F', Content = 'remove_item', Params = {item = {{id = 52412, num = 5}}}, Target = '收集5个圣诞花环', MapId = 49},
[55680001]={id = 55680001, NpcId = 4666, Name = '委托者的不满', Describe = '现在的冒险者都太浮躁，你一定没有看我为什么要礼盒纸，但如果你看了，那就请你快点。\n推荐区域：玩具工厂1F', Content = 'remove_item', Params = {item = {{id = 52108, num = 5}}}, Target = '收集5个礼盒纸', MapId = 49},
[55690001]={id = 55690001, NpcId = 4661, Name = '包装圣诞礼物', Describe = '马上要到圣诞节了，给朋友们的礼物已经准备好啦！需要礼盒纸包装一下，就拜托你啦！\n推荐区域：玩具工厂1F', Content = 'remove_item', Params = {item = {{id = 52108, num = 8}}}, Target = '收集8个礼盒纸', MapId = 49},
[55700001]={id = 55700001, NpcId = 4671, Name = '炎夏的愿望', Describe = '这鬼天气热的不想动，要是能给我几块冰块之角让我放到柠檬汁里那实在是太爽了！\n推荐区域：玩具工厂1F', Content = 'remove_item', Params = {item = {{id = 52158, num = 5}}}, Target = '收集5个冰块之角', MapId = 49},
[55710001]={id = 55710001, NpcId = 4658, Name = '商人的小把戏', Describe = '你要是能将冰块之角握在手里五分钟，我就可以让你把这些冰块之角给我。应该没问题！\n推荐区域：玩具工厂1F', Content = 'remove_item', Params = {item = {{id = 52158, num = 8}}}, Target = '收集8个冰块之角', MapId = 49},
[55720001]={id = 55720001, NpcId = 4655, Name = '痴情的少女', Describe = '既然名为冰之心，那它能不能将我的心冻结，让我永远忘记那个伤过我心的人。\n推荐区域：玩具工厂1F', Content = 'remove_item', Params = {item = {{id = 52208, num = 5}}}, Target = '收集5个冰之心', MapId = 49},
[55730001]={id = 55730001, NpcId = 4657, Name = '拯救病人', Describe = '这里有几个病人急需心脏移植手术，如果能给我8个冰之心，他们就有救了。\n推荐区域：玩具工厂1F', Content = 'remove_item', Params = {item = {{id = 52208, num = 8}}}, Target = '收集8个冰之心', MapId = 49},
[55740001]={id = 55740001, NpcId = 4669, Name = '宝石的魅力', Describe = '哪个女人能抵挡的了宝石的诱惑呢？听说最近布里刊很多火，我也想要一些。\n推荐区域：克雷斯特汉姆', Content = 'remove_item', Params = {item = {{id = 52105, num = 25}}}, Target = '收集25个布里刊', MapId = 27},
[55750001]={id = 55750001, NpcId = 4658, Name = '委婉的请求', Describe = '如果这所有的问题都能用慧眼解决，那还有什么意义？我愿承受这痛苦，把慧眼都给我吧！\n推荐区域：克特森林', Content = 'remove_item', Params = {item = {{id = 52155, num = 25}}}, Target = '收集25个慧眼', MapId = 34},
[55760001]={id = 55760001, NpcId = 4660, Name = '工作的效率', Describe = '世界上竟有这么棒的东西，使我工作事半功倍，这种东西请给我一车，开玩笑啦。\n推荐区域：吉芬地下', Content = 'remove_item', Params = {item = {{id = 52205, num = 25}}}, Target = '收集25个神之手', MapId = 24},
[55770001]={id = 55770001, NpcId = 4661, Name = '歌颂赛依伐', Describe = '把你的心我的心，串一串，串一段赛依伐，串个水晶项链！\n推荐区域：古城下水道', Content = 'remove_item', Params = {item = {{id = 52106, num = 20}}}, Target = '收集20个赛依伐', MapId = 28},
[55780001]={id = 55780001, NpcId = 4664, Name = '能力的证明', Describe = '深渊花，之所以这么叫大概是因为生长的环境我们难以触及吧，那么去收集20个给我看看。\n推荐区域：克特森林', Content = 'remove_item', Params = {item = {{id = 52156, num = 20}}}, Target = '收集20个深渊花', MapId = 34},
[55790001]={id = 55790001, NpcId = 4654, Name = '奥曼巴的烦恼', Describe = '虽然我不赞成对士兵们这样做，但是特殊事件还是特殊对待，帮我收集20个泯灭之心吧！\n推荐区域：古城下水道', Content = 'remove_item', Params = {item = {{id = 52206, num = 20}}}, Target = '收集20个泯灭之心', MapId = 28},
[55800001]={id = 55800001, NpcId = 4666, Name = '为了我爱的人', Describe = '曾经有一段真挚的感情摆在我面前而我没有珍惜，现在我要用时间结晶穿越回去挽回她！\n推荐区域：钟楼1F', Content = 'remove_item', Params = {item = {{id = 52107, num = 15}}}, Target = '收集15个时间结晶', MapId = 44},
[55810001]={id = 55810001, NpcId = 4656, Name = '最重要的配料', Describe = '听说姜饼城的罗恩用魔女星沙做的糖果深受孩子们喜欢，我也想试试！\n推荐区域：钟楼1F', Content = 'remove_item', Params = {item = {{id = 52157, num = 15}}}, Target = '收集15个魔女星沙', MapId = 44},
[55820001]={id = 55820001, NpcId = 4655, Name = '少女的心愿', Describe = '水晶骨，就是那种buling buling亮晶晶的骨头吗？听起来好可爱！我也想看看。\n推荐区域：钟楼地下', Content = 'remove_item', Params = {item = {{id = 52207, num = 15}}}, Target = '收集15个水晶骨', MapId = 46},
[55830001]={id = 55830001, NpcId = 4655, Name = '宏伟的雕像', Describe = '国境检查站那边有个膝盖中箭的士兵雕像！很有意思吧？可以帮我拍张照片留作纪念吗？\n推荐区域：国境检查站', Content = 'selfie', Params = _EmptyTable, Target = '拍摄士兵的雕像', MapId = 64},
[55840001]={id = 55840001, NpcId = 4664, Name = '神秘的建筑', Describe = '熔岩洞窟二层有一座神秘建筑，我很好奇到底是什么样子，可以帮我拍一张照片回来吗？\n推荐区域：熔岩洞窟2F', Content = 'selfie', Params = _EmptyTable, Target = '拍摄神秘的建筑', MapId = 67},
[55850001]={id = 55850001, NpcId = 4667, Name = '无用的善良', Describe = '为什么要杀掉火烈鸟，火烈鸟那么可爱，去帮我放生幼年火烈鸟吧！\n推荐区域：熔岩洞窟1F', Content = 'move', Params = _EmptyTable, Target = '去熔岩洞窟1F放生幼年火烈鸟', MapId = 66},
[55860001]={id = 55860001, NpcId = 4672, Name = '生存的权利', Describe = '世界是公平的，而个别极端分子却认为没有利用价值的生物是没有必要的存在，这真令我心寒！\n推荐区域：熔岩洞窟1F', Content = 'move', Params = _EmptyTable, Target = '去熔岩洞窟1F放生小火马', MapId = 66},
[55870001]={id = 55870001, NpcId = 4657, Name = '幸运的土拨鼠', Describe = '昨天在路上看到这只受伤的土拨鼠，已经给它包扎好伤口了，你去帮我把它送回去吧！\n推荐区域：国境检查站', Content = 'move', Params = _EmptyTable, Target = '去国境检查站放生土拨鼠', MapId = 64},
[55880001]={id = 55880001, NpcId = 4668, Name = '粗心的哈比', Describe = '今天在国境碰到了一只走丢了的哈比，它好像找不到回家的路了，你可以帮我把它送回家吗？\n推荐区域：国境检查站', Content = 'move', Params = _EmptyTable, Target = '去国境检查站放生鸟人哈比', MapId = 64},
[55890001]={id = 55890001, Name = '研究成果', Describe = '帮我传话给布廉，告诉他邪恶向日葵的特性，这种生物实在太霸道了！\n推荐区域：朱诺', Content = 'visit', Params = _EmptyTable, Target = '传话给布廉', MapId = 63},
[55900001]={id = 55900001, NpcId = 4665, Name = '朋友的关心', Describe = '我的好朋友凯蒂丝最近好像有点感情问题，但是又不好直接问她，你帮我把这封信交给她吧！\n推荐区域：国境检查站', Content = 'visit', Params = _EmptyTable, Target = '送信给凯蒂丝', MapId = 64},
[55910001]={id = 55910001, NpcId = 4660, Name = '应得的酬劳', Describe = '麦瑞答应我这个活儿做完了给我结酬劳，这都过去一周了，你去帮我问问他怎么回事？\n推荐区域：朱诺', Content = 'visit', Params = _EmptyTable, Target = '询问麦瑞关于酬劳的问题', MapId = 63},
[55920001]={id = 55920001, NpcId = 4668, Name = '拍摄飞空艇', Describe = '朱诺城的飞空艇很宏伟，可以帮我拍一张照片来吗?\n推荐区域：朱诺', Content = 'selfie', Params = _EmptyTable, Target = '拍摄飞空艇', MapId = 63},
[55930001]={id = 55930001, NpcId = 4664, Name = '地标性建筑', Describe = '朱诺城的海姆达水晶，美丽而神秘，我想拍张照留作纪念。\n推荐区域：朱诺', Content = 'selfie', Params = _EmptyTable, Target = '拍摄海姆达水晶', MapId = 63},
[55940001]={id = 55940001, NpcId = 4665, Name = '闲人不得靠近', Describe = '朱诺城的皇宫平时闲人免进，好想拍张照片给朋友们炫耀炫耀。\n推荐区域：朱诺', Content = 'selfie', Params = _EmptyTable, Target = '拍摄皇宫', MapId = 63},
[55950001]={id = 55950001, NpcId = 4662, Name = '协助审查', Describe = '艾因布洛克原野的城门已经竣工了，听说很雄伟啊，我抽不开身，帮我拍张照来看看吧。\n推荐区域：艾因布洛克原野', Content = 'selfie', Params = _EmptyTable, Target = '拍摄城门'},
[55960001]={id = 55960001, Name = '研究协助', Describe = '我需要时刻了解熔岩洞窟的情况，毕竟那里的岩浆令人堪忧。去帮我拍张照片看看现况吧。\n推荐区域：熔岩洞窟1F', Content = 'selfie', Params = _EmptyTable, Target = '拍摄熔岩洞窟的现状', MapId = 66},
[55970001]={id = 55970001, NpcId = 4659, Name = '传递情报', Describe = '最近熔岩洞窟的魔物有些焦躁，请帮我告诉普宁，看看怎么回事。\n推荐区域：朱诺', Content = 'visit', Params = _EmptyTable, Target = '帮看守者传达情报给普宁', MapId = 63},
